import React from "react";
import styled from "styled-components";
const Wrapper = styled.header`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 64px;
  background-color: white;
`;
function Header() {
  return (
    <Wrapper>
      <figure>
        <img src="/assets/header/logo.svg" alt="moogchi" />
      </figure>
    </Wrapper>
  );
}

export default Header;
